import { BrowserRouter as Router } from 'react-router-dom';
import './App.css';
import Footer from './components/Footer';
import Navbar from './components/Navbar';
function App() {
  const navLinks = [
      {to: '/signup', label:'Signup'},
      {to: '/login', label:'Login'}
  ]
  return (
    <Router>
    <div>
       <Navbar logo="WERTY" links={navLinks} />
       <Footer/>
    </div>
    </Router>

  );
}

export default App;
